import React from "react";
import styles from "./Home.module.css";
import Content from "../../Components/Content/Content";

const Home = () => {
  return (
    <Content>
      <div className={styles.home}>
        <div className={styles.homeContent}></div>
      </div>
    </Content>
  );
};

export default Home;
